def to_s(full = false)
        full ? entry : to_str
      end

def unknown_tag(tag_name, _markup, _tokenizer)
      Block.raise_unknown_tag(tag_name, block_name, block_delimiter, parse_context)
    end

def initialize(app, level = ::Logger::INFO)
        @app, @level = app, level
      end

def nodelist
      @blocks.map(&:attachment)
    end

def respond_to(*args)
        return @conditions[:provides] || base.respond_to if args.empty?

        @conditions[:provides] = args
      end

def ignore(path)
          watcher_for(path).ignore
        end

def html?(headers)
        return false unless (header = headers.detect { |k, _v| k.downcase == 'content-type' })

        options[:html_types].include? header.last[%r{^\w+/\w+}]
      end

def initialize(start_obj, end_obj)
      @start_obj = start_obj
      @end_obj   = end_obj
    end

def transform_keys(&block)
      dup.transform_keys!(&block)
    end

def parse(tokens)
      while parse_body(@blocks.last.attachment, tokens)
      end
      @blocks.reverse_each do |block|
        block.attachment.remove_blank_strings if blank?
        block.attachment.freeze
      end
    end

def call(env)
        app.call(env)
      end

def handle(_type, req, res)
    @request  = req
    @response = res

    @request.path_info =~ /(\w+)\z/
    @action  = Regexp.last_match(1) || 'index'
    @assigns = send(@action) if respond_to?(@action)

    @response['Content-Type'] = "text/html"
    @response.status = 200
    @response.body   = Liquid::Template.parse(read_template).render(@assigns, filters: [ProductsFilter])
  end

def self.parse_expression(parse_context, markup)
      @@method_literals[markup] || parse_context.parse_expression(markup)
    end

def watcher_for(path)
          @path_watcher_map[File.expand_path(path)]
        end

def equal_variables(left, right)
      if left.is_a?(MethodLiteral)
        if right.respond_to?(left.method_name)
          return right.send(left.method_name)
        else
          return nil
        end
      end

      if right.is_a?(MethodLiteral)
        if left.respond_to?(right.method_name)
          return left.send(right.method_name)
        else
          return nil
        end
      end

      left == right
    end

def drop_session(env)
        return unless session? env

        session(env).clear

        return if ["1", "true"].include?(ENV["RACK_PROTECTION_SILENCE_DROP_SESSION_WARNING"])

        warn env, "session dropped by #{self.class}"
      end

def unknown_tag(tag, markup, tokens)
      return super unless tag == 'else'
      @else_block = new_body
    end

def not_found(&block)
        error(404, &block)
      end

def <=>(other)
        other.priority <=> priority
      end

def test_doc_tag_ignores_nested_raw_tags
    template = <<~LIQUID.chomp
      {% doc %}
        {% raw %}
      {% enddoc %}
    LIQUID

    assert_template_result('', template)
  end

def call(env)
        logger = ::Logger.new(env[Rack::RACK_ERRORS])
        logger.level = @level

        env[Rack::RACK_LOGGER] = logger
        @app.call(env)
      end

def convert_key(key)
      key.is_a?(Symbol) ? key.to_s : key
    end

def self.registered(_)
      Sinatra::Request.include WebDAV::Request
    end

def increment!
      @index += 1

      if @col == @cols
        @col = 1
        @row += 1
      else
        @col += 1
      end
    end

def test_simple_cycle
    template = <<~LIQUID
      {%- cycle '1', '2', '3' -%}
      {%- cycle '1', '2', '3' -%}
      {%- cycle '1', '2', '3' -%}
    LIQUID

    assert_template_result("123", template)
  end

def key?(key)
      self[key] != nil
    end

def initialize(*)
        super
        @permitted_hosts = []
        @domain_hosts = []
        @ip_hosts = []
        @all_permitted_hosts = Array(options[:permitted_hosts])

        @all_permitted_hosts.each do |host|
          case host
          when String
            if host.start_with?(DOT)
              domain = host[1..-1]
              @permitted_hosts << domain.downcase
              @domain_hosts << /\A#{SUBDOMAINS}#{Regexp.escape(domain)}\z/i
            else
              @permitted_hosts << host.downcase
            end
          when IPAddr then @ip_hosts << host
          end
        end
      end

def objenc(x)
    '{' + x.map{|k,v| keyenc(k) + ':' + valenc(v)}.join(',') + '}'
  end

def app
    @app ||= nil
    @app || mock_app(DummyApp)
  end

def accepts?(env)
        session = session env
        key     = options[:tracking_key]
        if session.include? key
          session[key].all? { |k, v| v == encode(env[k]) }
        else
          session[key] = {}
          options[:track].each { |k| session[key][k] = encode(env[k]) }
        end
      end

def start_registering_extension
        @register_path = caller_files[2]
      end

def respond_with(*args, &block)
    respond_app { get('/') { respond_with(*args, &block) } }
  end

def initialize(value)
      super()
      @value = value
    end

def content_for(key, value = nil, options = {}, &block)
      block ||= proc { |*| value }
      clear_content_for(key) if options[:flush]
      content_blocks[key.to_sym] << capture_later(&block)
    end

def rassoc(value)
      super(convert_value(value))
    end

def initialize
    @allocated = []
    @retained  = []
    @headings  = []
  end

def config_for_env(hash)
      return from_environment_key(hash) if environment_keys?(hash)

      hash.each_with_object(IndifferentHash[]) do |(k, v), acc|
        if environment_keys?(v)
          acc.merge!(k => v[environment.to_s]) if v.key?(environment.to_s)
        else
          acc.merge!(k => v)
        end
      end
    end

def default
        @default ||= new
      end

def finish(reporter)
    if @exception.is_a?(NotImplementedError)
      from = @exception.backtrace[0]
      message = "#{@exception.message} (from #{from})"
      @pending_declared_in_example = message
      metadata[:pending] = true
      @exception = nil
    end

    __finish__(reporter)
  end

def children
        [
          @node.template_name_expr,
          @node.variable_name_expr,
        ] + @node.attributes.values
      end

def parse_expression(markup)
      Condition.parse_expression(parse_context, markup)
    end

def increment_assign_score(amount)
      @assign_score += amount
      raise_limits_reached if @assign_score_limit && @assign_score > @assign_score_limit
    end

def namespace(*args, &block)
    mock_app { namespace(*args, &block) }
  end

def route_def(pattern)
  mock_app { get(pattern) { } }
end

def ==(other)
        other.respond_to? :to_hash and to_hash == other.to_hash
      end

def add_filter(type, path = /.*/, **options, &block)
        filters[type] << compile!(type, path, block, **options)
      end

def erb(template, options = {}, locals = {}, &block)
      render(:erb, template, options, locals, &block)
    end

def self.use(*args, &block)
    Delegator.target.use(*args, &block)
  end

def load_slice(from, to)
      @load_slice_called = true
      @data[(from..to - 1)]
    end

def fetch(*key)
      @cache.fetch(key) do
        @cache[key] = yield
      end
    end

def initialize(app)
        @app = app
        @map = {}
        @generic = {}
        @default = nil
      end

def setup
    @hash = Sinatra::IndifferentHash[:a=>:a, ?b=>:b, 3=>3,
      :simple_nested=>{ :a=>:a, ?b=>:b },
      :nested=>{ :a=>[{ :a=>:a, ?b=>:b }, :c, 4], ?f=>:f, 7=>7 }
    ]
  end

def cookies(*set_cookies)
    cookie_route(*set_cookies) { cookies }
  end

def render!(*args)
      @rethrow_errors = true
      render(*args)
    end

def initialize(markup, parse_context)
      @markup        = markup
      @name          = nil
      @parse_context = parse_context
      @line_number   = parse_context.line_number

      strict_parse_with_error_mode_fallback(markup)
    end

def set(key, options = {})
        @response.set_cookie key.to_s, @options.merge(options)
      end

def new_parser(str)
    Parser.new(StringScanner.new(str))
  end

def lax_parse(markup)
      if markup =~ Syntax
        @variable_name   = Regexp.last_match(1)
        collection_name  = Regexp.last_match(2)
        @reversed        = !!Regexp.last_match(3)
        @name            = "#{@variable_name}-#{collection_name}"
        @collection_name = parse_expression(collection_name)
        markup.scan(TagAttributes) do |key, value|
          set_attribute(key, value)
        end
      else
        raise SyntaxError, options[:locale].t("errors.syntax.for")
      end
    end

def price(integer)
    format("$%.2d USD", integer / 100.0)
  end

def parse_raw_tag_body(tokenizer)
      while (token = tokenizer.send(:shift))
        return if token =~ BlockBody::FullTokenPossiblyInvalid && "endraw" == Regexp.last_match(2)
      end

      raise_tag_never_closed("raw")
    end

def initialize(tag_name, markup, options)
      super
      @variable_name = markup.strip
    end

def self.delegates(name)
    it "delegates #{name}" do
      m = mirror { send name }
      assert_equal [name.to_s], m.last_call
    end

    it "delegates #{name} with arguments" do
      m = mirror { send name, "foo", "bar" }
      assert_equal [name.to_s, "foo", "bar"], m.last_call
    end

    it "delegates #{name} with block" do
      block = proc { }
      m = mirror { send(name, &block) }
      assert_equal [name.to_s, block], m.last_call
    end
  end

def build(*middleware)
    endpoint = middleware.pop
    @app = Rack::Builder.app do
      middleware.each { |m| use m }
      run endpoint
    end
  end

def test_syntax_error_no_variable
    assert_raises(SyntaxError) { assert_template_result('', '{% if jerry == 1 %}') }
  end

def force_encoding(*args)
      settings.force_encoding(*args)
    end

def select(*args, &block)
      return to_enum(:select) unless block_given?

      dup.tap { |hash| hash.select!(*args, &block) }
    end

def setup
    @context = Context.new
  end

def concat(args)
        to_a.concat(args)
      end

def block_delimiter
