def setup
    @environment = Liquid::Environment.build do |env|
      env.register_filter(AccessScopeFilters)
    end

    @context = Context.build(environment: @environment)
  end

def test_map_over_drops_returning_procs
    drops = [
      {
        "proc" => -> { "foo" },
      },
      {
        "proc" => -> { "bar" },
      },
    ]
    output = Liquid::Template.parse('{{ drops | map: "proc" }}').render!({ "drops" => drops })
    assert_equal("foobar", output)
  end

def self.for(node, callbacks = Hash.new(proc {}))
      if defined?(node.class::ParseTreeVisitor)
        node.class::ParseTreeVisitor
      else
        self
      end.new(node, callbacks)
    end

def warn_for_deprecation(message)
        warn message + "\n\tfrom #{cleaned_caller.first.join(':')}"
      end

def remove_blank_strings
      raise "remove_blank_strings only support being called on a blank block body" unless @blank
      @nodelist.reject! { |node| node.instance_of?(String) }
    end

def test_proc_as_variable
    @context['dynamic'] = proc { 'Hello' }

    assert_equal('Hello', @context['dynamic'])
  end

def replace(other)
        select! { |k, _v| other.include?(k) or other.include?(k.to_s) }
        merge! other
      end

def test_transform_keys!
    @hash.transform_keys! { |k| k.respond_to?(:to_sym) ? k.to_sym : k }

    assert_equal :a, @hash[:a]
    assert_equal :a, @hash[?a]
  end

def key(value)
      super(convert_value(value))
    end

def test_case
    assigns = { 'condition' => 2 }
    assert_template_result(
      ' its 2 ',
      '{% case condition %}{% when 1 %} its 1 {% when 2 %} its 2 {% endcase %}',
      assigns,
    )

    assigns = { 'condition' => 1 }
    assert_template_result(
      ' its 1 ',
      '{% case condition %}{% when 1 %} its 1 {% when 2 %} its 2 {% endcase %}',
      assigns,
    )

    assigns = { 'condition' => 3 }
    assert_template_result(
      '',
      '{% case condition %}{% when 1 %} its 1 {% when 2 %} its 2 {% endcase %}',
      assigns,
    )

    assigns = { 'condition' => "string here" }
    assert_template_result(
      ' hit ',
      '{% case condition %}{% when "string here" %} hit {% endcase %}',
      assigns,
    )

    assigns = { 'condition' => "bad string here" }
    assert_template_result(
      '',
      '{% case condition %}{% when "string here" %} hit {% endcase %}',\
      assigns,
    )
  end

def test_doc_tag_preserves_error_line_numbers
    template = Liquid::Template.parse(<<~LIQUID.chomp, line_numbers: true)
      {% doc %}
        {% if true %}
      {% enddoc %}
      {{ errors.standard_error }}
    LIQUID

    expected = <<~TEXT.chomp

      Liquid error (line 4): standard error
    TEXT

    assert_equal(expected, template.render('errors' => ErrorDrop.new))
  end

