def assert_evaluates_true(left, op, right)
    assert(
      Condition.new(left, op, right).evaluate(@context),
      "Evaluated false: #{left.inspect} #{op} #{right.inspect}",
    )
  end

def resolve_content_type(options = {})
      options[:content_type] || settings.json_content_type
    end

def render(*)
        'foo' + super + 'bar'
      end

def ip_match?(host)
        @ip_hosts.any? { |ip_host| ip_host.include?(host) }
      rescue IPAddr::InvalidAddressError
        false
      end

def disable_tags(*tag_names)
        tag_names += disabled_tags
        define_singleton_method(:disabled_tags) { tag_names }
        prepend(Disabler)
      end

def initialize(path = DEFAULT_LOCALE)
      @path = path
    end

def visit(template)
    traversal(template).visit.flatten.compact
  end

def key?(key)
      @changes.key?(key) || @static.key?(key)
    end

def self.default_options(options)
        define_method(:default_options) { super().merge(options) }
      end
